import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function History() { // Component name matches PascalCase convention
  const [historyRecords, setHistoryRecords] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchHistory = async () => {
      const token = localStorage.getItem('jwt_token');
      if (!token) {
        navigate('/login');
        return;
      }
      try {
        const response = await axios.get('http://127.0.0.1:5000/api/history', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });
        setHistoryRecords(response.data.history);
      } catch (err) {
        console.error('Error fetching history:', err);
        setError(`Failed to load history: ${err.response?.data?.message || err.message}`);
        if (err.response?.status === 401) {
          navigate('/login'); // Redirect to login if unauthorized
        }
      } finally {
        setLoading(false);
      }
    };

    fetchHistory();
  }, [navigate]);

  const handleDownloadItr = async (recordId) => {
    const token = localStorage.getItem('jwt_token');
    if (!token) {
      navigate('/login');
      return;
    }
    try {
      setError(''); // Clear previous errors
      const response = await axios.get(`http://127.0.0.1:5000/api/generate_itr/${recordId}`, {
        headers: {
          'Authorization': `Bearer ${token}`
        },
        responseType: 'blob' // Important for downloading files
      });

      // Create a Blob from the response data
      const blob = new Blob([response.data], { type: 'application/pdf' });
      // Create a link element
      const link = document.createElement('a');
      link.href = window.URL.createObjectURL(blob);
      link.download = `ITR_Form_${recordId}.pdf`; // Suggest a filename
      document.body.appendChild(link); // Append to body
      link.click(); // Programmatically click the link to trigger the download
      document.body.removeChild(link); // Clean up the DOM
      window.URL.revokeObjectURL(link.href); // Release the object URL

    } catch (err) {
      console.error('Error downloading ITR:', err);
      setError(`Failed to download ITR: ${err.response?.data?.message || err.message}`);
      if (err.response?.status === 401) {
        navigate('/login'); // Redirect to login if unauthorized
      }
    }
  };

  if (loading) {
    return <div className="history-container">Loading tax history...</div>;
  }

  if (error) {
    return <div className="history-container error-message">{error}</div>;
  }

  return (
    <div className="history-container">
      <h2>Your Tax Filing History</h2>
      {historyRecords.length === 0 ? (
        <p>No tax records found. Upload documents to get started!</p>
      ) : (
        <ul className="history-list">
          {historyRecords.map((record) => (
            <li key={record._id} className="history-item">
              <h3>Record ID: {record._id}</h3>
              <p><strong>Name:</strong> {record.aggregated_financial_data?.name || 'N/A'}</p>
              <p><strong>PAN:</strong> {record.aggregated_financial_data?.pan || 'N/A'}</p>
              <p>
                <strong>Assessment Year:</strong> {record.aggregated_financial_data?.assessment_year || 'N/A'}
              </p>
              <p>
                <strong>Total Gross Income:</strong> ₹{record.aggregated_financial_data?.total_gross_income?.toFixed(2) || '0.00'}
              </p>
              <p>
                <strong>Taxable Income:</strong> ₹{record.final_tax_computation_summary?.computed_taxable_income?.toFixed(2) || '0.00'}
              </p>
              <p>
                <strong>Estimated Tax Payable:</strong> ₹{record.final_tax_computation_summary?.estimated_tax_payable?.toFixed(2) || '0.00'}
              </p>
              <p>
                <strong>Refund Due:</strong> ₹{record.final_tax_computation_summary?.refund_due_from_tax?.toFixed(2) || '0.00'}
              </p>
              <p>
                <strong>Tax Due:</strong> ₹{record.final_tax_computation_summary?.tax_due_to_government?.toFixed(2) || '0.00'}
              </p>
              <p>
                <strong>Processed Date:</strong> {new Date(record.timestamp).toLocaleDateString()}
              </p>
              <button onClick={() => handleDownloadItr(record._id)} className="download-button">
                Download ITR Form
              </button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default History;
